import "./VcanciesItem.css"
import {Link} from "react-router-dom";
import React, {useState} from "react";
import moment from "moment";

const VacanciesItem =({vac,mass})=> {
    const date = moment().format('DD.MM.YYYY');
    const [Date, setDate] = useState()
    console.log('mass=',mass)

    if(mass.create_date===date){
        setDate('NEW')
    }else{
        setDate('')
    }


    return (
        <>


            <div className="angry-grid1">
                <div id="item-01">{vac.name}</div>
                <div id="item-11">{Date}</div>
                <div id="item-21">{vac.description}</div>
                <div id="item-31"></div>
                <div id="item-41">{vac.create_date}</div>
            </div>
        </>
    )
}

export default VacanciesItem
